// import { Link } from "react-router-dom"

const Navbar = () => {
    const handleClick = (event) => {
        event.preventDefault();
        const target = event.target.getAttribute('href');
        const location = document.querySelector(target).offsetTop;
        window.scrollTo({
          top: location,
          behavior: 'smooth',
        });
    };
    
  return (
